def submit_redis():
	import redis
	r = redis.Redis(host='dev.werror.com', db=0, port=4328,  decode_responses=True)
	r.hmset("__ecdic", ecdic)
	print("done")

def load_dc():
	from diskcache import Index
	db= Index('/dcdata')
	for k,v in ecdic.items():
		db[k] = v
	print ('finished')	

def save():
	import json
	with open('ecdic','w') as fw: 
		fw.write(json.dumps([ (w, f) for w,f in ecdic.items()]))


if __name__ == '__main__': 
	import redis
	r = redis.Redis('files.jukuu.com', port=6666, decode_responses=True)
	print ( r.hset('dict:ecdic', mapping=ecdic)) 